import React from "react";
import { Route, Routes, Navigate } from "react-router-dom";
import Home from "./components/home";
import Signup from "./components/Signup";
import Login from "./components/Login";
import Movies from "./components/Moviespage/MovieDetails";

import Admin from "./components/Admin/Admin"; // Import the new component
import PrivateRoute from "./PrivateRoute";
// import AdminHome from "./components/Admin/Admin";
import AdminHome from "./"

function App() {
  return (
    <Routes>
      <Route path="/signup" element={<Signup />} />
      <Route path="/login" element={<Login />} />
      <Route path="/" element={<PrivateRoute />}>
        <Route path="/public/movies" element={<Home />} />
        <Route path="/movie/:_Id" element={<Movies />} />
        <Route path="/admin" element={<AdminHome/>} />
      </Route>
    </Routes>
  );
}
export default App;
